column6:
Compound Uptake into E. coli Can Be Facilitated by N-Alkyl Guanidiniums and Pyridiniums

//

DOI: https://dx.doi.org/10.1021/acsinfecdis.0c00715

//

To determine intracellular compound concentrations, treated cells were fractionated by repeated freeze-thaw cycles. Whole cell lysates were collected for analysis by LC-MS/MS.

//

Authors normalized the measured compound concentration by the number of CFU in the treatment setup (OD600 = 0.55) as determined by a calibration curve and reported results in nmol/1E12 CFU.

