DOI: https://doi.org/10.1021/cb5003015

//

To determine intracellular antibiotic concentrations, cells treated with antibiotics in the presence of the efflux pump inhibitors PAßN (20 ug/mL), reserpine (20 ug/mL), or CCCP (100 uM) were lysed by sonication and fractionated by centrifugation. Antibiotic concentrations in the lysate and supernatants were analyzed by LC-MS/MS. CFU determination was made following incubation with antibiotics. 

//

Authors took species-specific cell volumes from the literature and used those values with the measured CFUs to convert µM to nmol/1E12 CFU.

//

Information on the solvents in which test article or additives were resuspended was not stated.

