Predictive compound accumulation rules yield a broad-spectrum antibiotic

//

DOI: https://doi.org/10.1038/nature22308

//

To determine intracellular compound concentrations, cells treated with antibiotics were pelleted through silicone oil then fractionated by repeated freeze-thaw cycles. Whole cell lysates were collected for analysis by LC-MS/MS.

//

Authors normalized the measured compound concentration by the number of CFU in the treatment setup (OD600 = 0.55) as determined by a calibration curve and reported results in nmol/1E12 CFU.

Development and Optimization of a Higher-Throughput Bacterial Compound Accumulation Assay

//

DOI: https://doi.org/10.1021/acsinfecdis.8b00299

//

To determine total cell antibiotic concentrations, treated cells were lysed with 50% acetonitrile. Antibiotic concentrations were analyzed by solid-phase extraction tandem mass spectrometry (SPE-MS/MS). To quantify the compound, the ng/mL value of compound obtained from a calibration curve was normalized to the OD600 value obtained for the specific test well and units were reported at ng/OD600. 

//

For calculations in SPARK, it was assumed authors meant ng/mL/OD600 and that 1 OD600 unit is 1E9 CFU/mL. The reported value was multiplied by 1000 to convert ng to pg then divided by the molecular weight of the compound (g/mol) to achieve nmol/1E12 CFU.

