C14-labelled erythromycin in filtered cell-free supernatant on a 96-well filter microtiter plate was measured with a scintillation counter. Concentrations were reported in uM (micromol compound per liter volume of cells). 

//

The authors assume that OD600 = 1 contains 1E9 E. coli CFU/mL with an average cell volume of 1 um^3. As part of curation, values reported in uM were converted to nmol/1E12 CFU by first converting micromole to nmol, then normalizing nmol per cell based on the assumption that the average cell volume is 1 um^3 (equivalent to 1 fL).

