Development of a liquid chromatography/mass spectrometry-based drug accumulation assay in Pseudomonas aeruginosa

//

DOI: https://doi.org/10.1016/j.ab.2008.10.041

//

To determine intracellular compound concentrations, treated cells were lysed in 0.1 N glycine-HCl and filtered to obtain cell-free lysate. Compound concentration was measured by LC-MS/MS and quantified against a standard curve.

//

Authors assumed that OD600 = 1 contains 5E8 CFU with an average cellular volume of 1 um^3 (equivalent to 1 fL). As part of curation, values reported by the authors in ng/mL were converted to pg/1E9 CFU based on this assumption, then divided by the molecular weight of the compound to achieve nmol/1E12 CFU.

