To determine intracellular compound concentrations, treated cells were fractionated in 0.1 M glycine-HCl [pH 3]. Compound concentration was measured by spectrofluorimetry and quantified against calibration curves, then normalized to the reported cell density of 6E9 CFU/mL.

//

As part of curation, values reported by the authors in 1E-11 ug/cell was converted to ug per 1E9 CFU, then divided by the molecular weight of the compound to achieve nmol/1E12 CFU.

